"main";const { SAMPLES_SINE, SAMPLES_SINE_NOISE } = function () {
  let samples = []
  let samplesNoise = []
  let seconds = 30
  let freq = 1
  let amp = 3
  let rate = 120
  let noiseAmp = 1

  let t = 0
  let delta = 1 / rate

  for (let s = 0; s <= seconds; s++) {
    for (let i = 0; i < rate; i++) {
      let value = Math.sin(t * 2 * Math.PI * freq) * amp
      let valueNoise = value + (Math.random() * 2 - 1) * noiseAmp
      samples.push(value)
      samplesNoise.push(valueNoise)
      t += delta
    }
  }

  return { samples, samplesNoise }
} ();

